con:config.script:
/* This is for getting Authorization Code from the User*/

com.eviware.soapui.SoapUI.globalProperties.removeProperty("Access_token")

def authorizationKey = com.eviware.soapui.support.UISupport.prompt( "Enter Authorization Token to proceed", "Authorization");
log.info(authorizationKey);
com.eviware.soapui.SoapUI.globalProperties.setPropertyValue("Access_token", authorizationKey);

/* This is for getting Data source from the User */

def ui = com.eviware.soapui.support.UISupport;

List<String> choice = new ArrayList<String>();
List<String> values = new ArrayList<String>();

// Some example data:
choice.add('CLQ')
choice.add('EMOL')
choice.add('STELLA TXO')

values.add('CLQ')
values.add('EMOL')
values.add('STELLA TXO')

// Ask the question
def selectedDatasource = ui.prompt("Select a Datasource", "Data Source", choice)

testRunner.testCase.testSuite.setPropertyValue("datasourceName", selectedDatasource)

// The answer
log.info selectedDatasource

// The position of the answer
log.info choice.indexOf(selectedDatasource)

// The associated value
log.info values.get(choice.indexOf(selectedDatasource))


/* Final Confirmation Script */
com.eviware.soapui.support.UISupport.showInfoMessage('Access Token added & Data source Selcted. Click OK to Run Scripts')

